import React, {useState, useEffect} from 'react';
import {
  AppBar,
  Button,
  CssBaseline,
  Grid,
  TextField,
} from '@mui/material';

function App() {
  return (
    <>
        <Grid item xs={12}>
          <TextField
            id="titleInput"
            label="Title"
            value={currentNoteTitle}
            variant="standard"
            fullWidth
            onChange={handleTextInput}
          />
        </Grid>
        <Grid item xs={12}>
          <TextareaAutosize
            id="contentInput"
            placeholder="Add Note Content"
            value={currentNoteContent}
            minRows={3}
            style={{ width: "100%"}}
            onChange={handleTextInput}
          />
        </Grid>
        <Grid item xs={12}>
          <Button children='Submit' id="submitNote" variant="contained" sx={{width:"100%"}} onClick={buttonOnClickHandler} />
        </Grid>
    </>
  );
}

export default App;
